import React, { Fragment } from 'react';
import Navbar from './components/Navbar';
import './App.css';
import Home from './components/pages/Home';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import User from './user_home/User';
import Login from './components/pages/Login';
import Menu from './menu/Menu';
import UserMenu from './menu/UserMenu';
import Adduser from "./User/Adduser";
import Alluser from './admin_home/Admin_AllUser';
import Admin from './admin_home/Admin';
import AddUser from './admin_home/Admin_addUser';
import AddMenu from './admin_home/Pages/Admin_AddMenu';
// import Sidebar from './admin_home/Sidebar';

function App() {
  return (
    <>
      <Router>
      <Route path='/admin/alluser' component={Alluser} />
        <Navbar>
          <Switch>
            <Route path='/' exact component={Home} />
          </Switch>
        </Navbar>
        <Switch>

          <Route path='/admin/menu' component={AddMenu} />
          <Route path='/admin/adduser' component={AddUser}></Route>

          <Route path='/services' component={AddMenu} />
          <Route path='/products' component={User}>
          </Route>
          <Route path='/admin' component={Admin} />

          <Route path='/sign-up' component={Login} />

          <Route path='/user/menu' component={UserMenu} />

        </Switch>

        {/* <Sidebar /> */}
        {/* <Switch> */}
        {/* <Route path='/adduser' component={Adduser} /> */}
        {/* </Switch> */}
      </Router>
    </>
  );
}

export default App;
